The alert component is defined similar to the other components we've implemented in this book. Our model stores whether the component is visible and the configuration. /// Alert dialog component.
pub struct Alert { settings: AlertSettings, is_active: bool,
} We define a Widgets, Init, Input and Output type as usual. type Widgets = AlertWidgets; type Init = AlertSettings; type Input = AlertMsg; type Output = AlertResponse; The Init param is a settings object that is used to configure the component. This maximizes the reusability of the component by letting it adapt to different use-cases. /// Configuration for the alert dialog component
pub struct AlertSettings { /// Large text pub text: String, /// Optional secondary, smaller text pub secondary_text: Option<String>, /// Modal dialogs freeze other windows as long they are visible pub is_modal: bool, /// Sets color of the accept button to red if the theme supports it pub destructive_accept: bool, /// Text for confirm button pub confirm_label: String, /// Text for cancel button pub cancel_label: String, /// Text for third option button. If [`None`] the third button won't be created. pub option_label: Option<String>,
} In the Input type, this component uses #[doc(hidden)] on the Response variant. This is a useful pattern for component-internal messages that are not intended to be sent by outside callers. This allows us to update the component when the underlying dialog reports a response, but not display the Response variant in the component's documentation. /// Messages that can be sent to the alert dialog component
#[derive(Debug)]
pub enum AlertMsg { /// Message sent by the parent to view the dialog Show, #[doc(hidden)] Response(gtk::ResponseType),
} The Output type allows us to report the user's response back to a parent component. /// User action performed on the alert dialog.
#[derive(Debug)]
pub enum AlertResponse { /// User clicked confirm button. Confirm, /// User clicked cancel button. Cancel, /// User clicked user-supplied option. Option,
} The update function handles the Show message from our parent component and the Response messages generated by user interactions. It also sends the appropriate messages to the parent through the output sender. fn update(&mut self, input: AlertMsg, sender: ComponentSender<Self>) { match input { AlertMsg::Show => { self.is_active = true; } AlertMsg::Response(ty) => { self.is_active = false; sender .output(match ty { gtk::ResponseType::Accept => AlertResponse::Confirm, gtk::ResponseType::Other(_) => AlertResponse::Option, _ => AlertResponse::Cancel, }) .unwrap(); } } } When initializing the model, we conditionally set up some widgets based on the settings passed by the caller. We set is_active to false since the dialog is not currently displayed. fn init( settings: AlertSettings, root: Self::Root, sender: ComponentSender<Self>, ) -> ComponentParts<Self> { let model = Alert { settings, is_active: false, }; let widgets = view_output!(); if let Some(option_label) = &model.settings.option_label { widgets .dialog .add_button(option_label, gtk::ResponseType::Other(0)); } if model.settings.destructive_accept { let accept_widget = widgets .dialog .widget_for_response(gtk::ResponseType::Accept) .expect("No button for accept response set"); accept_widget.add_css_class("destructive-action"); } ComponentParts { model, widgets } } Lastly, the view. Note that the component connects to the response signal of the underlying dialog and sends an input to itself when a response is received. view! { #[name = "dialog"] gtk::MessageDialog { set_message_type: gtk::MessageType::Question, #[watch] set_visible: model.is_active, connect_response[sender] => move |_, response| { sender.input(AlertMsg::Response(response)); }, // Apply configuration set_text: Some(&model.settings.text), set_secondary_text: model.settings.secondary_text.as_deref(), set_modal: model.settings.is_modal, add_button: (&model.settings.confirm_label, gtk::ResponseType::Accept), add_button: (&model.settings.cancel_label, gtk::ResponseType::Cancel), } }

