With the component complete, let's use it! struct App { counter: u8, alert_toggle: bool, dialog: Controller<Alert>, second_dialog: Controller<Alert>,
} #[derive(Debug)]
enum AppMsg { Increment, Decrement, CloseRequest, Save, Close, Ignore,
} #[relm4::component]
impl SimpleComponent for App { type Input = AppMsg; type Output = (); type Init = (); view! { main_window = gtk::ApplicationWindow { set_title: Some("Simple app"), set_default_width: 300, set_default_height: 100, connect_close_request[sender] => move |_| { sender.input(AppMsg::CloseRequest); gtk::glib::Propagation::Stop }, gtk::Box { set_orientation: gtk::Orientation::Vertical, set_margin_all: 5, set_spacing: 5, append = &gtk::Button { set_label: "Increment", connect_clicked[sender] => move |_| { sender.input(AppMsg::Increment); }, }, append = &gtk::Button { set_label: "Decrement", connect_clicked[sender] => move |_| { sender.input(AppMsg::Decrement); }, }, append = &gtk::Label { set_margin_all: 5, #[watch] set_label: &format!("Counter: {}", model.counter), }, append = &gtk::Button { set_label: "Close", connect_clicked[sender] => move |_| { sender.input(AppMsg::CloseRequest); }, }, }, } } fn update(&mut self, msg: AppMsg, _sender: ComponentSender<Self>) { match msg { AppMsg::Increment => { self.counter = self.counter.wrapping_add(1); } AppMsg::Decrement => { self.counter = self.counter.wrapping_sub(1); } AppMsg::CloseRequest => { if self.counter == 42 { relm4::main_application().quit(); } else { self.alert_toggle = !self.alert_toggle; if self.alert_toggle { self.dialog.emit(AlertMsg::Show); } else { self.second_dialog.emit(AlertMsg::Show); } } } AppMsg::Save => { println!("* Open save dialog here *"); } AppMsg::Close => { relm4::main_application().quit(); } AppMsg::Ignore => (), } } fn init(_: (), root: Self::Root, sender: ComponentSender<Self>) -> ComponentParts<Self> { let model = App { counter: 0, alert_toggle: false, dialog: Alert::builder() .transient_for(&root) .launch(AlertSettings { text: String::from("Do you want to quit without saving? (First alert)"), secondary_text: Some(String::from("Your counter hasn't reached 42 yet")), confirm_label: String::from("Close without saving"), cancel_label: String::from("Cancel"), option_label: Some(String::from("Save")), is_modal: true, destructive_accept: true, }) .forward(sender.input_sender(), convert_alert_response), second_dialog: Alert::builder() .transient_for(&root) .launch(AlertSettings { text: String::from("Do you want to quit without saving? (Second alert)"), secondary_text: Some(String::from("Your counter hasn't reached 42 yet")), confirm_label: String::from("Close without saving"), cancel_label: String::from("Cancel"), option_label: Some(String::from("Save")), is_modal: true, destructive_accept: true, }) .forward(sender.input_sender(), convert_alert_response), }; let widgets = view_output!(); ComponentParts { model, widgets } }
} fn convert_alert_response(response: AlertResponse) -> AppMsg { match response { AlertResponse::Confirm => AppMsg::Close, AlertResponse::Cancel => AppMsg::Ignore, AlertResponse::Option => AppMsg::Save, }
} fn main() { let app = RelmApp::new("relm4.example.alert"); app.run::<App>(());
} This is mostly stuff that we've already done in previous chapters, but there are a few additional things to know about interacting with child components. Notably, we need to wrap the types of the child components in Controllers to be able to store them in the App model. struct App { counter: u8, alert_toggle: bool, dialog: Controller<Alert>, second_dialog: Controller<Alert>,
} We initialize them with the builder pattern in the init method. fn init(_: (), root: Self::Root, sender: ComponentSender<Self>) -> ComponentParts<Self> { let model = App { counter: 0, alert_toggle: false, dialog: Alert::builder() .transient_for(&root) .launch(AlertSettings { text: String::from("Do you want to quit without saving? (First alert)"), secondary_text: Some(String::from("Your counter hasn't reached 42 yet")), confirm_label: String::from("Close without saving"), cancel_label: String::from("Cancel"), option_label: Some(String::from("Save")), is_modal: true, destructive_accept: true, }) .forward(sender.input_sender(), convert_alert_response), second_dialog: Alert::builder() .transient_for(&root) .launch(AlertSettings { text: String::from("Do you want to quit without saving? (Second alert)"), secondary_text: Some(String::from("Your counter hasn't reached 42 yet")), confirm_label: String::from("Close without saving"), cancel_label: String::from("Cancel"), option_label: Some(String::from("Save")), is_modal: true, destructive_accept: true, }) .forward(sender.input_sender(), convert_alert_response), }; let widgets = view_output!(); ComponentParts { model, widgets } } We call transient_for(root) on the builder to indicate to GTK that our root widget is transient for the main application window. This allows window managers to handle the dialog window differently, e.g. by drawing it on top of other windows. See the set_transient_for documentation for more information. AppMsg::CloseRequest => { if self.counter == 42 { relm4::main_application().quit(); } else { self.alert_toggle = !self.alert_toggle; if self.alert_toggle { self.dialog.emit(AlertMsg::Show); } else { self.second_dialog.emit(AlertMsg::Show); } } } That's it! You can find more examples of reusable components in the relm4-components crate here . You can also contribute your own reusable components to relm4-components :)

