To define a widget template, you need to implement the WidgetTemplate trait for a new type. You could do this manually, but the easiest solution is to use the #[relm4::widget_template] attribute macro. The macro will create the type and implement the trait for you. For example, the following code block will create a template for a gtk::Box with a certain margin and custom CSS. #[relm4::widget_template]
impl WidgetTemplate for MyBox { view! { gtk::Box { set_margin_all: 10, // Make the boxes visible inline_css: "border: 2px solid blue", } }
} Similarly, we can create a template for a gtk::Spinner that already spins when it's created. #[relm4::widget_template]
impl WidgetTemplate for MySpinner { view! { gtk::Spinner { set_spinning: true, } }
} To create public templates, you can use #[relm4::widget_template(pub)], similar to the #[relm4::component(pub)] macro.

