Templates are more than just pre-initialized widgets. They can also have children, which can be referred to later as template children. This is very useful if you use nested widget in you UI, because the template allows you to flatten the structure. In other words, no matter how deeply nested a template child is, it will always be accessible directly from the template. We'll see how this works in the next section, but first we'll create a deeply nested template. We use the templates we defined earlier by using the #[template] attribute. Also, we assign the name child_label to our last widget, which is all we need to make it a template child. In general, naming a widget in a template is all that's needed to make it a template child. #[relm4::widget_template]
impl WidgetTemplate for CustomBox { view! { gtk::Box { set_orientation: gtk::Orientation::Vertical, set_margin_all: 5, set_spacing: 5, #[template] MyBox { #[template] MySpinner, #[template] MyBox { #[template] MySpinner, #[template] MyBox { #[template] MySpinner, // Deeply nested! #[name = "child_label"] gtk::Label { set_label: "This is a test", } } } } } }
}

