The handling of CLI arguments in Relm4 has some specifics you should be aware of. The first one is that Relm4/GTK tries to parse the arguments again even if you parsed them yourself already. This means the program will crash with an error like Unknown option --non-gtk-arg. To fix this you can use the with_args method to provide the arguments the GTK app should parse. The easiest way is to just provide an empty Vec but this has the disadvantage that the standard GTK arguments don't work anymore. We will now make it work in combination with the popular clap crate. To be precise we will use the derive feature which you can learn about in the clap documentation but it works with the builder pattern too of course. To pass a Vec of GTK arguments we need to separate the arguments we want to consume ourselfes from those we want to pass to GTK. In clap you can achieve this using a combination of allow_hyphen_values and trailing_var_arg . #[derive(Parser, Debug)]
#[command(version, about, long_about = None)]
struct Args { /// some argument to test #[arg(long)] non_gtk_arg: bool, /// Unknown arguments or everything after -- gets passed through to GTK. #[arg(allow_hyphen_values = true, trailing_var_arg = true)] gtk_options: Vec<String>,
} Now in our main function we can parse the CLI arguments using Args::parse() and pass args.gtk_options to GTK/Relm4. The first argument is (as per convention) the program invocation so we need to add that first: let program_invocation = std::env::args().next().unwrap(); let mut gtk_args = vec![program_invocation]; gtk_args.append(&mut args.gtk_options.clone()); let app = RelmApp::new("relm4.test.helloworld_cli"); app.with_args(gtk_args).run::<AppModel>(());

