The view macro allows you to include if and match statements for conditionally showing widgets. Internally, the macro will use a gtk::Stack, so you can also use different transition types . if model.value % 2 == 0 { gtk::Label { set_label: "The value is even", }, gtk::Label { set_label: "The value is odd", }
} // Use a transition type to set an animation when the visible widget changes
#[transition = "SlideRight"]
match model.value { 0..=9 => { gtk::Label { set_label: "The value is below 10", }, } _ => { gtk::Label { set_label: "The value is equal or above 10", }, }
} If your conditional widget uses a match statement over an enum, you can destructure the enum in the match arms to access its variables with the help of the #[track] or #[watch] macros: enum Foo { Bar(f32), Baz(String),
} struct FooView { foo: Foo
} impl Component for FooView { type Init = Foo; // snip view! { #[root] gtk::Box { append = match &model.foo { Foo::Bar(num_value) => { gtk::SpinButton { // adding the `watch` macro lets you reference the destructured variables #[watch] set_value: num_value } } Foo::Baz(str_value) => { gtk::Label { #[watch] set_text: &str_value } } } } } // snip
} Please note: if you attempt to destructure in the normal way - without the track or watch macros - you will get a compilation error, and Rust will 'fail to see' the destructured variables at the point where your code uses them. This is due to limitations in Relm4's component initialization strategy. Please ensure that you use one of those macros to avoid this.

