A neat feature of factories is that each element can easily forward their output messages to the input of their parent component. For example, this is necessary for modifications that require access to the whole FactoryVecDeque, like moving an element to a new position. Therefore, these actions are covered by the output type. The actions we want to perform "from outside" are Move a counter up Move a counter down Move a counter to the first position Accordingly, our message type looks like this: #[derive(Debug)]
enum CounterOutput { SendFront(DynamicIndex), MoveUp(DynamicIndex), MoveDown(DynamicIndex),
} You might wonder why DynamicIndex is used here. First, the parent component needs to know which element should be moved, which is defined by the index. Further, elements can move in the FactoryVecDeque. If we used usize as index instead, it could happen that the index points to another element by the time it is processed.

