enum AppMsg { SetMode(AppMode), CloseRequest, Close,
} struct AppModel { mode: AppMode, header: Controller<HeaderModel>, dialog: Controller<DialogModel>,
} The AppMode struct stores the modes the application can be in. The SetMode message is transformed from the output of our header bar component to update the state of the main application when someone presses a button in the header bar. The Close message is transformed from the output of the dialog component to indicate that the window should be closed. In the model, we store the current AppMode as well as a Controller for each of our child components. The update function of the model is pretty straightforward. fn update(&mut self, msg: Self::Input, _sender: ComponentSender<Self>) { match msg { AppMsg::SetMode(mode) => { self.mode = mode; } AppMsg::CloseRequest => { self.dialog.sender().send(DialogInput::Show).unwrap(); } AppMsg::Close => { relm4::main_application().quit(); } } } We can retrieve a sender for the child component by calling the sender() method on the associated Controller, and then send messages of the associated Input type through it.

