When initializing the app component, we construct the child components by passing the appropriate Init and forwarding any desired inputs and outputs. This is done through a builder provided by Component implementations. We pass the initial parameters via the launch method, and then retrieve the final Controller by calling the forward method. In addition to starting the component, the forward method allows us to take the outputs of the component, transform them with a mapping function, and then pass the result as an input message to another sender (in this case, the input sender of the app component). If you don't need to forward any outputs, you can start the component with the detach method instead. fn init( params: Self::Init, root: Self::Root, sender: ComponentSender<Self>, ) -> ComponentParts<Self> { let header: Controller<HeaderModel> = HeaderModel::builder() .launch(()) .forward(sender.input_sender(), |msg| match msg { HeaderOutput::View => AppMsg::SetMode(AppMode::View), HeaderOutput::Edit => AppMsg::SetMode(AppMode::Edit), HeaderOutput::Export => AppMsg::SetMode(AppMode::Export), }); let dialog = DialogModel::builder() .transient_for(&root) .launch(true) .forward(sender.input_sender(), |msg| match msg { DialogOutput::Close => AppMsg::Close, }); let model = AppModel { mode: params, header, dialog, }; let widgets = view_output!(); ComponentParts { model, widgets } } Also, we set the set_transient_for property, which actually uses the main window. The dialog should set his parent window so that GTK can handle the dialog better. The GTK docs state: "[set_transient_for] allows window managers to e.g. keep the dialog on top of the main window, or center the dialog over the main window". #[derive(Debug)]
